  as 'urban' all territory, population, and housing units located within an urbanized
  area (UA) or an urban cluster (UC). It delineates UA and UC boundaries to encompass
  densely settled territory, which consists of: - core census block groups or blocks
  that have a population density of at least 1,000 people per square mile and - surrounding
  census blocks that have an overall density of at least 500 people per square mile
